targets.expr:
sum by(lang) (
    increase(code_suggestions_accepts_total{lang=~".+"}[1d])
)
/ on(lang) group_left()
    sum by(lang) (
    increase(code_suggestions_requests_total{lang=~".+"}[1d]) > 0
) + ignoring(year, month, day) group_right
  count_values without() ("year", year(timestamp(
    count_values without() ("month", month(timestamp(
      count_values without() ("day", day_of_month(timestamp(
        sum by(lang) (
    increase(code_suggestions_accepts_total{lang=~".+"}[1d])
)
/ on(lang) group_left()
    sum by(lang) (
    increase(code_suggestions_requests_total{lang=~".+"}[1d]) > 0
)
      )))
    )))
  ))) * 0

