sum by (lang, symbol) (increase(code_suggestions_prompt_symbols_total[$__range])) + ignoring(year, month, day) group_right
  count_values without() ("year", year(timestamp(
    count_values without() ("month", month(timestamp(
      count_values without() ("day", day_of_month(timestamp(
        sum by (lang, symbol) (increase(code_suggestions_prompt_symbols_total[$__range]))
      )))
    )))
  ))) * 0
